<?php
function solution( $K, $A )
{
	$C = count( $A );
	for( $I = 0; $I < count( $A ) - 1; $I++  )
	{
		$MN = $A[ $I ];
		$MX = $A[ $I ];
		
		for ( $O = 1; $I + $O < count( $A ) ; $O++ )
		{
			if ( $A[ $I + $O ] > $MX )
				$MX = $A[ $I + $O ];
			else if ( $A[ $I + $O ] < $MN )
				$MN = $A[ $I + $O ];

			echo "<td>$O($MN,$MX)</td>";
			if ( $MX - $MN > $K )
				break;
			
			$C++;
			echo "<td>$I:$C</td>";
		}

		if ( $C >= 1000000000 )
			return 1000000000;
		echo "</tr><tr>";
	}
	return $C;
}

function solution2( $K, $A )
{
	$C = count( $A );
	$MN = $A[ 0 ];
	$MX = $A[ 0 ];
	$O = 1;
	for( $I = 0; $I < count( $A ) - 1; $I++  )
	{
		if ( $O > 1 && $A[ $I ] != $MN && $A[ $I ] != $MX )
			$C += --$O - 1;
		else
		{
			$O = 1;
			$MN = $A[ $I ];
			$MX = $A[ $I ];
		}
		
		for ( ; $I + $O < count( $A ) ; $O++ )
		{
			if ( $A[ $I + $O ] > $MX && $A[ $I + $O ] - $MN <= $K )
				$MX = $A[ $I + $O ];
			else if ( $A[ $I + $O ] < $MN && $MX - $A[ $I + $O ] <= $K )
				$MN = $A[ $I + $O ];

			echo "<td>$O($MN,$MX)</td>";
			if ( $A[ $I + $O ] > $MX || $A[ $I + $O ] < $MN )
				break;
					
			$C++;
			echo "<td>$I:$C</td>";
		}

		if ( $C >= 1000000000 )
			return 1000000000;
		echo "</tr><tr>";
	}
	return $C;
}
